  -- Input control counter combinatorial logic
  InputControl_output : PROCESS (dinVldSM, rdCountReverse_1, rdCount_1, sharingCount_1, wrCount_1)
    VARIABLE out4 : unsigned(11 DOWNTO 0);
  BEGIN
    delayLineValidInP <= hdlcoder_to_stdlogic((sharingCount_1 = to_unsigned(16#000#, 12)) AND (dinVldSM = '1'));
    lastPhaseStrobe <= hdlcoder_to_stdlogic(sharingCount_1 = to_unsigned(16#95F#, 12));
    IF (dinVldSM = '1') OR (sharingCount_1 > to_unsigned(16#000#, 12)) THEN 
      IF sharingCount_1 = to_unsigned(16#95F#, 12) THEN 
        nextSharingCount <= (OTHERS => '0');
      ELSE 
        nextSharingCount <= sharingCount_1 + to_unsigned(16#001#, 12);
      END IF;
    ELSE 
      nextSharingCount <= sharingCount_1;
    END IF;
    IF dinVldSM = '1' THEN 
      IF wrCount_1 = to_unsigned(16#95F#, 12) THEN 
        out4 := (OTHERS => '0');
      ELSE 
        out4 := wrCount_1 + to_unsigned(16#001#, 12);
      END IF;
    ELSE 
      out4 := wrCount_1;
    END IF;
    IF (rdCount_1 /= out4) OR (dinVldSM = '1') THEN 
      IF rdCount_1 = to_unsigned(16#000#, 12) THEN 
        nextDelayLineRdAddr <= (10 DOWNTO 9 => '0', 7 => '0', 5 => '0', OTHERS => '1');
      ELSE 
        nextDelayLineRdAddr <= rdCount_1 - to_unsigned(16#001#, 12);
      END IF;
    ELSE 
      nextDelayLineRdAddr <= rdCount_1;
    END IF;
    IF (sharingCount_1 > to_unsigned(16#000#, 12)) OR (dinVldSM = '1') THEN 
      IF sharingCount_1 = to_unsigned(16#95F#, 12) THEN 
        IF wrCount_1 = to_unsigned(16#95F#, 12) THEN 
          nextDelayLineRdAddrReverse <= (OTHERS => '0');
        ELSE 
          nextDelayLineRdAddrReverse <= wrCount_1 + to_unsigned(16#001#, 12);
        END IF;
      ELSIF rdCountReverse_1 = to_unsigned(16#95F#, 12) THEN 
        nextDelayLineRdAddrReverse <= (OTHERS => '0');
      ELSE 
        nextDelayLineRdAddrReverse <= rdCountReverse_1 + to_unsigned(16#001#, 12);
      END IF;
    ELSE 
      nextDelayLineRdAddrReverse <= rdCountReverse_1;
    END IF;
    nextDelayLineWrAddr <= out4;
  END PROCESS InputControl_output;


